import React from 'react';
import { StyledNavbar } from './Navbar.styled';
import { Typography } from '@mui/material';

const Navbar: React.FC = () => {
  return (
    <StyledNavbar>
      <Typography 
        variant='h1'
      >W807</Typography>

      <ul>
        <li>Timezones
            <p>US & EU</p>
        </li>
        <li>Where
            <p>Discord</p>
        </li>
        <li>When
            <p>Every Weekend</p>
        </li>
        <li>Wanna See?
            <p>Galleria</p>
        </li>
      </ul>
    </StyledNavbar>
  );
}

export default Navbar;
